import React from 'react';
import masterpiece from './post-photo1.jpeg';
import PostFooter from './PostFooter';
import PostHeader from './PostHeader';
import './Post.css';

const Post = ({ comment, dateOfPost, nickName, countOfLikes, photoDescription, subtitle }) => {
  return (
    <article className="post">
      <PostHeader nickName={nickName} subtitle={subtitle} />
      <img className="post__photo" src={masterpiece} alt="post-foto1" />
      <PostFooter
        comment={comment}
        dateOfPost={dateOfPost}
        countOfLikes={countOfLikes}
        photoDescription={photoDescription}
      />
    </article>
  );
};

export default Post;
